webpackJsonp([0xb53eed87de2e],{7424:function(e,t){e.exports={data:{post:{html:'<p>The Union is just 0.8% ahead of the SPD in the latest count, and the media are <a href="http://www.spiegel.de/politik/deutschland/0,1518,375255,00.html" title="Hochrechnungsdrama: Umfrage sieht SPD in F&uuml;hrung - Politik - SPIEGEL ONLINE">speculating</a> that the notorious <a href="http://en.wikipedia.org/wiki/Overhang_seat">overhang seats</a> could give the SPD a majority in the Bundestag. So maybe that\'s why Schr&ouml;der grinning so broadly in the \'elephant round\' in ARD/ZDF (<a href="http://www.tagesschau.de/video/0,1315,OID4766940_RES_NAV_BAB,00.html">video</a>), At AFOE Tobias Schwarz speculates that <a href="http://fistfulofeuros.net/archives/001900.php" title="A Fistful of Euros: Grand coalition under Schr&ouml;der?">Schr&ouml;der may lead a grand coalition</a>, and maybe that\'s not so far fetched.</p>',fields:{title:"Who's On First?",date:"18 Sep 2005",url:"https://papascott.de/2005-09-18-whos-on-first/"}}},pathContext:{slug:"/2005-09-18-whos-on-first/",prev:{fields:{title:"Nobody Wins",date:"18 Sep 2005",slug:"/2005-09-18-nobody-wins/"}},next:{fields:{title:"Before and After",date:"19 Sep 2005",slug:"/2005-09-19-before-and-after/"}}}}}});
